// BuildHTML : get base bootstrap html
func BuildHTML(body string, jsArea ...string) string {
	js := ""
	if jsArea != nil {
		js = jsArea[0]

		// log.Println(js)
	}
	return fmt.Sprintf(`<!DOCTYPE html>
<html>
	<head>
		<meta charset="utf-8">
		<style type="text/css" >%s</style>
	</head>
	<body class="h-100" style="        position: absolute; width:100%%;">
`, BootstrapCSS) + body + fmt.Sprintf(`
		<script >%s</script>
		<script >%s</script>
		<script >%s</script>
		<script >%s</script>
	</body>
</html>`, Jquery, BootstrapPopJS, BootstrapJS, js)
}
